import DemoBox from "@/components/DemoBox"
import {
  motion,
  useAnimationFrame,
  useInView,
  useMotionValue,
  useTransform,
} from "motion/react"
import { useEffect, useRef, useState } from "react"
import { Pane } from "tweakpane"

const Demo = () => {
  const ref = useRef<HTMLDivElement>(null)

  const position = useMotionValue(0)
  const isInView = useInView(ref)
  const backgroundPosition = useTransform(position, (v) => `center ${v}%`)

  useAnimationFrame((_, delta) => {
    if (!isInView) return
    let newPosition = position.get() + (delta / 16000 / 3) * 900
    if (newPosition > 900) {
      newPosition = newPosition - 900
    }
    position.set(newPosition)
  })

  const paneWrapper = useRef<HTMLDivElement>(null)
  const paneRef = useRef<Pane | null>(null)
  const [params, setParams] = useState({
    scale: 45,
    frequency: 0.008,
  })

  useEffect(() => {
    paneRef.current = new Pane({
      container: paneWrapper.current,
    })

    paneRef.current.on("change", (ev) => {
      setParams((prev) => ({
        ...prev,
        // @ts-ignore
        [ev.target.label]: ev.value,
      }))
    })

    paneRef.current.addBlade({
      view: "slider",
      label: "scale",
      min: -256,
      max: 80,
      value: 45,
    })

    return () => {
      if (paneRef.current) {
        paneRef.current.dispose()
      }
    }
  }, [])

  return (
    <DemoBox className="flex overflow-hidden">
      <div ref={paneWrapper} className="absolute top-1 left-1/2 -translate-x-1/2" />
      <div className="flex-1 flex flex-col gap-4 items-center justify-center">
        <img
          className="flex-none relative size-36 rounded-2xl overflow-hidden"
          src="data:image/png;base64,"
        />
        <div className="flex-none relative size-36 rounded-2xl overflow-hidden">
          <svg
            width="144"
            height="144"
            viewBox="0 0 144 144"
            xmlns="http://www.w3.org/2000/svg"
          >
            <defs>
              <filter
                id="displacement-filter-demo-0"
                width="1"
                height="1"
                x="0"
                y="0"
                colorInterpolationFilters="sRGB"
              >
                <feImage
                  id="feimage"
                  width="100%"
                  height="100%"
                  x="0"
                  y="0"
                  result="displacement-filter-demo-0-10_MAP"
                  href="data:image/png;base64,"
                />
                <feDisplacementMap
                  id="displacement-filter-demo-0-displacement"
                  in="SourceGraphic"
                  in2="displacement-filter-demo-0-10_MAP"
                  scale={params.scale}
                  xChannelSelector="R"
                  yChannelSelector="B"
                />
              </filter>
            </defs>
            <image
              id="map"
              href="https://wxa.wxs.qq.com/wxad-design/yijie/fedm_pattern-a.svg"
              width="100%"
              height="100%"
              style={{
                filter: "url(#displacement-filter-demo-0)",
              }}
            />
          </svg>
        </div>
      </div>
      <motion.div
        ref={ref}
        className="flex-1 flex items-center justify-center gap-4 flex-col md:flex-row h-[400px]"
        style={{
          backgroundImage:
            "url(https://wxa.wxs.qq.com/wxad-design/yijie/glass-demo.jpg)",
          backgroundSize: "300px auto",
          backgroundPosition,
        }}
      >
        <motion.div
          drag
          dragConstraints={{
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
          }}
          dragElastic={1}
          className="flex-none relative size-36 rounded-2xl cursor-grab active:cursor-grabbing"
        >
          <div
            className="absolute-full rounded-2xl"
            style={{
              filter: "url(#displacement-filter-demo-0)",
              backdropFilter: "blur(0px) ",
            }}
          />
          <div
            className="absolute-full rounded-2xl"
            style={{
              boxShadow:
                "rgba(0, 0, 0, 0.25) 0px 4px 8px, rgba(0, 0, 0, 0.15) 0px -10px 25px inset, rgba(255, 255, 255, 0.74) 0px -1px 4px 1px inset",
            }}
          />
        </motion.div>
      </motion.div>
    </DemoBox>
  )
}

export default Demo
